        Long: "你相信童话故事吗？否则，你将如何解释即将展开的故事！在充满挑战的土地上，将数百个物体合并在一起，收集和收获资源，按照你想要的方式设计你自己的岛屿。\n\n在这片充满挑战的土地上，将数百个物体合并在一起，收集和收获资源，设计你自己的岛屿，使它成为你想要的样子 找到匹配和合并各种碎片的最佳方法，以建立最大的建筑物和种植最丰硕的植物 帮助重建Mergest王国，使其成为第七界中最神奇的王国!\n\n梅里斯特王国是什么样子的？\n\n你的世界! 只有在这里，你才能找到你将会合并的最令人惊奇的物品!\n你的选择! 你可以合并龙、树、宝石，以及你在发现之旅中发现的几乎任何东西!\n你的规则! 岛屿上充满了合并魔法和合并工艺，使你能够以你想要的方式进行最大的合并!\n\n任务和挑战\n\n参加每日任务，收集金币和宝石。\n挖掘各种资源来建设。\n探索广阔的魔域,其中充满了神秘的生物,令人眼花缭乱的人物,和迷人的物体,在这个无限的世界中!\n\n如果你喜欢合并游戏，这种合并体验将是你的完美选择",
