        Short:
          "2099年，地球面临着空前的危机，突如其来的外星机器人威胁着人类的生存。国家紧急推出了顶尖科技所孕育的机器人战甲，人类的命运紧紧束缚在这些机甲的钢铁之上。\n《机械战警》是一款竞技类游戏，玩家将扮演一名机甲师，选择与其他各族勇士一起投身战斗，奋力守护地球的最后防线。\n机器人战甲在游戏中扮演核心角色。玩家可以通过收集资源和经验升级战甲，不断强化战甲的装备、武器和技能。每款战甲都有拥有独特的特点和技能，有的擅长近身格斗，有的则以远程火力主导。玩家可以根据战局需要自由切换不同战甲，制定多样化的战斗策略。\n游戏中的战斗场景丰富多样且精彩纷呈，玩家将在废弃都市、外星球、太空空间等多种环境中与外星机器人展开战斗。画面精美的游戏世界，平滑流畅的操作体验，将让玩家身临其境地为保护地球而战斗。\n游戏将促使玩家踏上一场宏大的保卫地球之旅。在这个充满科幻色彩的世界里，机甲师们将用自己的力量，书写出地球人类与外星机器人之间的终极对决。",
