        Long: "1.庇护所管理和升级资源：\n使用鼠标点击来管理和升级你的庇护所资源。这包括食物、水源、医疗设备等。\n鼠标点击背包可强化你的装备和武器。\n2.探险模式：\n使用WSAD来控制玩家的移动，移动到合适的位置。\n使用鼠标点击攻击按钮，消灭变异者和怪物。\n这些操作将帮助您在这个充满挑战的世界中生存。祝您好运!",
        Short:
          "公元9096年，世界遭受毁灭性的打击，文明崩溃，资源匮乏，人类陷入绝境。为了生存，一群幸存者聚集在第九街区的地下庇护所，这个地方成为他们最后的避难所。\n1.生存挑战：\n在庇护所中，资源有限，食物、水源、医疗设备都成为了珍贵的物品。你需要精明地管理这些资源，以确保庇护所居民的生存。你的每一决策都可能关系到庇护所的存亡。\n2.升级和强化：\n为了对抗日益严峻的环境，你可以升级和强化各种武器、装备、枪支和防具。这将提高你的战斗力，增加生存几率。\n3.资源获取与科技发展：\n在庇护所中，你可以培育粮食，净化获得优质水源，研发疫苗，提高自身学习能力，进行生化实验，甚至建造火箭。这些资源和技术将有助于生存和探索。\n4.探索与冒险：\n你将携带着强大的武器和装备，勇敢地探索各种有趣的场景和关卡。这个废墟世界中充满了怪物和危险，但也隐藏着珍贵的资源和答案。只有冒险，才有希望。\n在《末日生存日记》中，你将亲身体验一个充满生存挑战和未知的未来世界。需要运用智慧和资源管理技巧，不仅为自己，还为其他庇护所居民争取生存的机会。你将揭开这个未来世界的秘密，成为一个真正的求生英雄。",
